import "./index.css";
const Jokes = (props) => {
  const jokes = props;
  console.log(jokes.jokes);

  return (
    <table border="1" cellSpacing="0">
      <tr>
        <td>{jokes.jokes.category}</td>
        <td>{jokes.jokes.type}</td>
        <td>{jokes.jokes.lang}</td>
        <td>{jokes.jokes.type}</td>
      </tr>
    </table>
  );
};
export default Jokes;
